import React from 'react';

const CountryFlagIcon = ({ country }) => {

    var images = <></>;

    if ( country.toLowerCase().includes('usa') )
        images += <img src={`https://flags.fmcdn.net/data/flags/mini/us.png`} />
    
    if ( country.toLowerCase() == 'uk' )
        images += <img src={`https://flags.fmcdn.net/data/flags/mini/uk.png`} />


    return images;
};

export default CountryFlagIcon;
